{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyPjqGkzjqiSYaCWRhmpHjKU"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","execution_count":4,"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":927},"id":"wJpSB6jcCgyb","executionInfo":{"status":"ok","timestamp":1734949674582,"user_tz":-120,"elapsed":4870,"user":{"displayName":"Ярослав Білотіл","userId":"06797585363548962278"}},"outputId":"7a56e4de-ce2c-4419-d9a3-8cd070cca5cc"},"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}},{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}}],"source":["# Імпортуємо необхідні бібліотеки\n","import numpy as np\n","import matplotlib.pyplot as plt\n","from sklearn.cluster import KMeans\n","from sklearn.datasets import load_iris\n","from sklearn.metrics import pairwise_distances_argmin\n","\n","# Завантажуємо набір даних Iris\n","iris = load_iris()  # Завантажуємо набір даних Iris\n","X = iris['data']  # Атрибути (довжина чашолистка, ширина чашолистка, довжина пелюстки, ширина пелюстки)\n","y = iris['target']  # Мітки класів (0 - Setosa, 1 - Versicolor, 2 - Virginica)\n","\n","# Створюємо модель KMeans з 3 кластерами (оскільки в Iris 3 класи)\n","kmeans = KMeans(n_clusters=3, random_state=42)\n","\n","# Навчаємо модель на наших даних\n","kmeans.fit(X)\n","\n","# Прогнозуємо кластери для кожного зразка\n","y_kmeans = kmeans.predict(X)\n","\n","# Візуалізуємо результат кластеризації\n","plt.scatter(X[:, 0], X[:, 1], c=y_kmeans, s=50, cmap='viridis')  # Розміщуємо точки з кольором кластерів\n","centers = kmeans.cluster_centers_  # Отримуємо центри кластерів\n","plt.scatter(centers[:, 0], centers[:, 1], c='black', s=200, alpha=0.5)  # Розміщуємо центри кластерів\n","plt.title(\"KMeans Clustering (Iris Dataset)\")\n","plt.xlabel(\"Feature 1: Sepal Length\")\n","plt.ylabel(\"Feature 2: Sepal Width\")\n","plt.show()  # Відображаємо графік\n","\n","# Додаткове завдання: Створюємо власну функцію для знаходження кластерів (без використання KMeans)\n","def find_clusters(X, n_clusters, rseed=2):\n","    # Ініціалізуємо випадковий генератор чисел\n","    rng = np.random.RandomState(rseed)\n","    # Вибираємо випадкові початкові центри кластерів\n","    i = rng.permutation(X.shape[0])[:n_clusters]\n","    centers = X[i]\n","\n","    # Виконуємо кластеризацію за допомогою методу K-середніх\n","    while True:\n","        # Для кожної точки знаходиться найближчий центр\n","        labels = pairwise_distances_argmin(X, centers)\n","\n","        # Обчислюємо нові центри кластерів\n","        new_centers = np.array([X[labels == i].mean(0) for i in range(n_clusters)])\n","\n","        # Якщо нові центри не змінилися, алгоритм завершено\n","        if np.all(centers == new_centers):\n","            break\n","        centers = new_centers\n","\n","    return centers, labels  # Повертаємо центри і мітки кластерів\n","\n","# Використовуємо функцію для кластеризації з 3 кластерами\n","centers, labels = find_clusters(X, 3)\n","\n","# Візуалізуємо результат кластеризації, виконаної вручну\n","plt.scatter(X[:, 0], X[:, 1], c=labels, s=50, cmap='viridis')\n","plt.scatter(centers[:, 0], centers[:, 1], c='red', s=200, alpha=0.5)  # Центри кластерів\n","plt.title(\"Manual Clustering (Iris Dataset)\")\n","plt.xlabel(\"Feature 1: Sepal Length\")\n","plt.ylabel(\"Feature 2: Sepal Width\")\n","plt.show()  # Відображаємо графік\n"]}]}